import { ref, computed, onMounted } from 'vue';
import { apiService } from '@/services/api';
// Reactive state
const content = ref([]);
const loading = ref(false);
const saving = ref(false);
const deleting = ref(false);
// Filter states
const searchQuery = ref('');
const selectedSection = ref('');
const selectedStatus = ref('');
// Modal states
const showModal = ref(false);
const showDeleteModal = ref(false);
const isEditing = ref(false);
const contentToDelete = ref(null);
// Form data
const formData = ref({
    title: '',
    content: '',
    section: '',
    status: 'draft',
});
const editingId = ref(null);
// Computed properties
const filteredContent = computed(() => {
    let filtered = content.value;
    if (searchQuery.value) {
        const query = searchQuery.value.toLowerCase();
        filtered = filtered.filter(item => item.title.toLowerCase().includes(query) ||
            item.content.toLowerCase().includes(query));
    }
    if (selectedSection.value) {
        filtered = filtered.filter(item => item.section === selectedSection.value);
    }
    if (selectedStatus.value) {
        filtered = filtered.filter(item => item.status === selectedStatus.value);
    }
    return filtered;
});
// Methods
const loadContent = async () => {
    try {
        loading.value = true;
        content.value = await apiService.getBusinessContent();
    }
    catch (error) {
        console.error('Failed to load content:', error);
    }
    finally {
        loading.value = false;
    }
};
const openCreateModal = () => {
    isEditing.value = false;
    formData.value = {
        title: '',
        content: '',
        section: '',
        status: 'draft',
    };
    editingId.value = null;
    showModal.value = true;
};
const editContent = (item) => {
    isEditing.value = true;
    formData.value = {
        title: item.title,
        content: item.content,
        section: item.section,
        status: item.status,
    };
    editingId.value = parseInt(item.id);
    showModal.value = true;
};
const closeModal = () => {
    showModal.value = false;
    formData.value = {
        title: '',
        content: '',
        section: '',
        status: 'draft',
    };
    editingId.value = null;
};
const saveContent = async () => {
    try {
        saving.value = true;
        if (isEditing.value && editingId.value) {
            const updated = await apiService.updateBusinessContent(editingId.value, formData.value);
            const index = content.value.findIndex(item => item.id === editingId.value);
            if (index !== -1) {
                content.value[index] = updated;
            }
        }
        else {
            const created = await apiService.createBusinessContent(formData.value);
            content.value.unshift(created);
        }
        closeModal();
    }
    catch (error) {
        console.error('Failed to save content:', error);
    }
    finally {
        saving.value = false;
    }
};
const togglePublishStatus = async (item) => {
    try {
        const newStatus = item.status === 'published' ? 'draft' : 'published';
        const updated = await apiService.updateBusinessContent(item.id, {
            status: newStatus
        });
        const index = content.value.findIndex(c => c.id === item.id);
        if (index !== -1) {
            content.value[index] = updated;
        }
    }
    catch (error) {
        console.error('Failed to update publish status:', error);
    }
};
const deleteContent = (item) => {
    contentToDelete.value = item;
    showDeleteModal.value = true;
};
const cancelDelete = () => {
    contentToDelete.value = null;
    showDeleteModal.value = false;
};
const confirmDelete = async () => {
    if (!contentToDelete.value)
        return;
    try {
        deleting.value = true;
        await apiService.deleteBusinessContent(contentToDelete.value.id);
        content.value = content.value.filter(item => item.id !== contentToDelete.value.id);
        showDeleteModal.value = false;
        contentToDelete.value = null;
    }
    catch (error) {
        console.error('Failed to delete content:', error);
    }
    finally {
        deleting.value = false;
    }
};
const getSectionClass = (section) => {
    const classes = {
        'background': 'bg-blue-100 text-blue-800 dark:bg-blue-900 dark:text-blue-200',
        'team': 'bg-green-100 text-green-800 dark:bg-green-900 dark:text-green-200',
        'strategy': 'bg-purple-100 text-purple-800 dark:bg-purple-900 dark:text-purple-200',
        'roadmap': 'bg-yellow-100 text-yellow-800 dark:bg-yellow-900 dark:text-yellow-200',
        'tokens': 'bg-pink-100 text-pink-800 dark:bg-pink-900 dark:text-pink-200',
    };
    return classes[section] || 'bg-gray-100 text-gray-800 dark:bg-gray-900 dark:text-gray-200';
};
const getSectionLabel = (section) => {
    const labels = {
        'background': '회사 소개',
        'team': '사업 소개',
        'strategy': '사업 계획',
        'roadmap': '생태계 토큰',
        'tokens': '추진 사업',
    };
    return labels[section] || section;
};
const getStatusClass = (status) => {
    const classes = {
        'published': 'bg-green-100 text-green-800 dark:bg-green-900 dark:text-green-200',
        'draft': 'bg-yellow-100 text-yellow-800 dark:bg-yellow-900 dark:text-yellow-200',
        'archived': 'bg-gray-100 text-gray-800 dark:bg-gray-900 dark:text-gray-200',
    };
    return classes[status] || 'bg-gray-100 text-gray-800 dark:bg-gray-900 dark:text-gray-200';
};
const getStatusLabel = (status) => {
    const labels = {
        'published': 'Published',
        'draft': 'Draft',
        'archived': 'Archived',
    };
    return labels[status] || status;
};
const formatDate = (dateString) => {
    return new Date(dateString).toLocaleDateString('en-US', {
        year: 'numeric',
        month: 'short',
        day: 'numeric',
        hour: '2-digit',
        minute: '2-digit',
    });
};
// Initialize
onMounted(() => {
    loadContent();
});
